description:
Title: Besieger
Developer: Primal Software
Publisher: DreamCatcher Interactive Inc.
Genre: RTS
Released: 2004
Description: Become Barmalay, leader of the Vikings, in search of freedom. Then join Korin, the overthrown Cimmerian king, in a valiant quest to restore peace and reclaim his throne. Complete all three epic campaigns to finally bring peace back to the kingdom devastated by magical creatures and fratricidal wars.

Installation:
1) Mount or burn game images;
2) Install the game;
3) Apply the patch from Patch dir on first disc;
4) Copy cracked executable from Crack dir on first disc to game install dir, overwriting the original file;
5) Play the game without the CD;
6) Support the producer.
